import { minReorder } from "./reorder-routes-to-make-all-paths-lead-to-the-city-zero";

test('reorders roads minimally 1', () => {
    const n = 6
    const connections = [[0,1],[1,3],[2,3],[4,0],[4,5]]

    expect(minReorder(n, connections)).toEqual(3)
})

test('reorders roads minimally 2', () => {
    const n = 5
    const connections = [[1,0],[1,2],[3,2],[3,4]]

    expect(minReorder(n, connections)).toEqual(2)
})

test('reorders roads minimally 3', () => {
    const n = 3
    const connections = [[1,0],[2,0]]

    expect(minReorder(n, connections)).toEqual(0)
})

